import React from 'react';
import { Menu } from 'antd';
import { GithubOutlined, LinkedinFilled } from '@ant-design/icons';
import "./header.css";
import { Anchor,Col } from 'antd';
const { Link } = Anchor;

const labels = ['Home', 'Skills', 'Projects', 'Contact'];
const items = labels.map((label, index) => ({
  key: index + 1,
  label: `${label}`,
}));

const AppHeader = () => {
  return (
    <div id="header" className='container-fluid'>
      <div className='header'>
        <div className='logo' />

      <Anchor targetOffset="80"
        items={[
          {
            key: 'banner',
            href: '#banner',
            title: 'Banner',
          },
          {
            key: 'feature',
            href: '#feature',
            title: 'Feature',
          },
          {
            key: 'hero',
            href: '#hero',
            title: 'Projects',
          },
          {
            key: 'contact',
            href: '#contact',
            title: 'Contact',
          },
        ]}
      />

        <div className="icon-container">
          <a href="https://github.com/zehragizem" target="_blank" rel="noopener noreferrer" className="github">
            <GithubOutlined style={{ fontSize: '18px', color: '#fff' }} />
          </a>
          <a href="https://www.linkedin.com/in/zehra-gizem-duman-344952237" target="_blank" rel="noopener noreferrer" className="linkedin">
            <LinkedinFilled style={{ fontSize: '18px', color: '#fff' }} />
          </a>

        </div>

      </div>
    </div>
  );
}

export default AppHeader;
